export default function ActivityTypeScreen({ navigation }) {
  const [option, setOption] = useState('');
  const navigateToMindBodyDeckScreen = () => {
    if (option !== '') {
      navigation.navigate('Mind and Body Deck', {
        type: option,
      });
    }
  };

  // const navigateToActivityDurationScreen = () => {
  //   if (option !== '') {
  //     navigation.navigate('Activity Duration', {
  //       type: option,
  //     });
  //   }
  // };

  const selectMental = () => {
    setOption('mental');
  };
  const selectPhysical = () => {
    setOption('physical');
  };
  const selectBoth = () => {
    setOption('both');
  };

  return (
    <View style={styles.container}>
      <View style={styles.banner}>
        <Pressable onPress={() => { navigation.goBack(); }} style={styles.back}>
          <SvgXml
            xml={backSVG}
            style={styles.design}
            height={15}
            width={15}
          />
        </Pressable>
        <View />
      </View>
      <Progress.Bar progress={0.333} width={windowWidth * 0.8} height={8} borderRadius={50} borderWidth={0} unfilledColor="#333333" color="white" style={styles.bar} />
      <Text style={styles.heading}>What part of you needs a refresh right now?</Text>
      <Pressable style={[option === 'mental' ? styles.selectedOption : styles.unselectedOption]} onPress={selectMental}>
        <SvgXml
          xml={mentalSVG}
          style={styles.design}
          // height="100%"
          width="100%"
        />
      </Pressable>
      <Pressable style={[option === 'physical' ? styles.selectedOption : styles.unselectedOption]} onPress={selectPhysical}>
        <SvgXml
          xml={physicalSVG}
          style={styles.design}
          // height="100%"
          width="100%"
        />
      </Pressable>
      <Pressable style={[option === 'both' ? styles.selectedOption : styles.unselectedOption]} onPress={selectBoth}>
        <SvgXml
          xml={allSVG}
          style={styles.design}
          // height="100%"
          width="100%"
        />
      </Pressable>
      <Pressable style={styles.button} onPress={navigateToMindBodyDeckScreen}>
        <Text style={styles.buttonBody}>Next</Text>
      </Pressable>
    </View>
  );
}

ActivityTypeScreen.propTypes = {
  navigation: PropTypes.shape({
    navigate: PropTypes.func,
    goBack: PropTypes.func,
  }).isRequired,
};
